<div class="section">
    <h1>Miscellany</h1>
    <div class="section">
        <h2>Close Icon</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <p>The default float is clear for example purposes</p>
            <div data-example>
                <p>
                    <a href="#" style="float:none;" class="close">&times; <span class="sr">Close</span></a>
                </p>
            </div>
        </div>
    </div>
    <div class="section">
        <h2>Caret</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <div data-example>
                <div>
                    <p>
                        <span class="caret-n"></span>
                    </p>
                    <p>
                        <span class="caret-e"></span>
                    </p>
                    <p>
                        <span class="caret-s"></span>
                    </p>
                    <p>
                        <span class="caret-w"></span>
                    </p>
                    <p>
                        <span class="caret"></span>
                    </p>
                </div>
            </div>
        </div>
    </div>
</div>
<div class="section">
    <h1>Images</h1>
    <div class="section">
        <h2>Standard</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <div data-example>
                <div class="row">
                    <div class="span-md-2">
                        <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/155378/kanga.png">
                    </div>
                </div>
            </div>
        </div>
    </div>
    <div class="section">
        <h2>Responsive</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <div data-example>
                <div class="row">
                    <div class="span-md-2">
                        <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/155378/kanga.png"
                        class="img-responsive">
                    </div>
                </div>
            </div>
        </div>
    </div>
    <div class="section">
        <h2>Rounded Edge</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <div data-example>
                <div class="row">
                    <div class="span-md-3">
                        <div>
                            <img src="data:image/jpeg;base64,"
                            class="img-rounded">
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
    <div class="section">
        <h2>Circle</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <div data-example>
                <div class="row">
                    <div class="span-md-3">
                        <div>
                            <img src="data:image/jpeg;base64,"
                            style="width: 150px;height: 150px;" class="img-circle">
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
    <div class="section">
        <h2>Thumbs</h2>
        <div class="silk-example">
            <span class="lang">example</span>
            <div data-example>
                <div class="row">
                    <div class="span-md-3">
                        <div>
                            <img src="data:image/jpeg;base64,"
                            class="img-thumb">
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</div>